import{_ as a,o as e,c as t,Q as o}from"./chunks/framework.0d568df4.js";const u=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"FAQ.md","filePath":"FAQ.md"}'),r={name:"FAQ.md"},p=o('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><p>Общая информация, популярные вопросы и ответы на них.</p><h2 id="faq-с-дискорда" tabindex="-1">FAQ с дискорда <a class="header-anchor" href="#faq-с-дискорда" aria-label="Permalink to &quot;FAQ с дискорда&quot;">​</a></h2><p>В: Экраны очков Walksnail имеют формат 4:3 или режим 4:3 обрезает их? О: Экраны очков имеют формат 16:9, как и датчики изображения на современных камерах, поэтому при использовании режима 4:3 видеоизображение обрезается.</p><p>В: Нужно ли перезагружать очки после обновления прошивки? О: Это больше не требуется.</p><p>В: Как называются различные прошивки и что они означают? О: SE - это прошивка для VRX, Sky - для VTX, а GND - для очков/VRX.</p><p>В: Какого размера входной разъем постоянного тока? О: Это бочкообразный разъем 5,5 / 2,1 мм.</p><p>В: Какого размера разъем питания VTX? О: Это 6-контактный разъем JST SH 1 мм.</p><p>В: Какой тип разъема видеовыхода установлен на VRX? О: Это выход Mini HDMI. (отредактировано)</p><p>В: Можно ли отключить экранное меню? О: Эта функция была добавлена в прошивку версии V31.36.8. Обновитесь до этой прошивки (или более поздней), чтобы иметь возможность отключать встроенный экранный дисплей, а также дисплейный порт MSP.</p><p>В: Может ли Avatar работать со скоростью 120 кадров в секунду в очках. О: нет</p><p>В: Какая система Avatar - 100 или 120fps? О: - 100fps максимум.</p><p>В: Будет ли режим 1080p 120fps. О : Нет, требуется аппаратное обновление.</p><p>В: Какой тип разъемов у нового V2/V3 VTX? О: Используется разъем ST0.8 HSG 6P / ST0.8 HSG 4P (V3 vtx)</p><h2 id="замеры-потребления" tabindex="-1">Замеры потребления <a class="header-anchor" href="#замеры-потребления" aria-label="Permalink to &quot;Замеры потребления&quot;">​</a></h2><p>Потребление 1с юнита ( замер от @wizard_rnd )</p><ol><li>на 5В без подключения к приёмнику 1s-юнит потребляет 500 мА (ток стабильный), при понижении напряжения до 4В ток растёт до 750-800 мА</li><li>при подключении к врх и в стендбае на 5В ток 1000 мА (ток скачет в пределах 100 мА), при понижении напряжения до 4В ток растёт до 1500 мА</li><li>при отключении стендбая и установленных в меню врх 700 mW на 5В ток 1300 мА (тоже скачет примерно как в пункте 2), при понижении до 4В ток растёт до 2А, дальше понижать напругу побоялся.</li></ol><blockquote><p>В общем, похоже, мои &quot;домашние&quot; проблемы были связаны с не особо качественными беками, плохо тянувшими ток от 1,5А. Что как бы намекает на отдельный бортовой бек для юнита на том же коптере.</p></blockquote><h2 id="рекомендуемые-параметры-камер" tabindex="-1">Рекомендуемые параметры камер: <a class="header-anchor" href="#рекомендуемые-параметры-камер" aria-label="Permalink to &quot;Рекомендуемые параметры камер:&quot;">​</a></h2><p>dnr : off всегда. Шумадав сильно шакалит картинку и шумы всюравно малоцветные - выше детализация при всех условиях. PS шумадав работает на очках в видео с двр юнита без него. mode: night/day для про камеры (ночь без фонарей день с фонарями) , для обычной в сумерках всегда ставим night (лишние пару стопов света). днем day. Saturation: 4 WhiteBalance: всегда фиксированый ставим на глаз 4800 \\ 5500 \\ day \\ cloud.<br> Sharpness: 1 AspectRatio : на v2 v3 камере 4:3 на v1, nano light, pro - 16:9 (это нативные соотношения сторон для камер). для vrx и например sky04x ставим режим 4:3 full будет картинка растянутая на всю матрицу очков.</p><h2 id="шрифты" tabindex="-1">Шрифты <a class="header-anchor" href="#шрифты" aria-label="Permalink to &quot;Шрифты&quot;">​</a></h2><p><a href="https://sites.google.com/view/sneaky-fpv/home" target="_blank" rel="noreferrer">https://sites.google.com/view/sneaky-fpv/home</a></p>',22),i=[p]